// Función para redondear a N cifras significativas
function redondearCifrasSignificativas(num, cifras) {
  if (num === 0) return 0;
  const d = Math.ceil(Math.log10(Math.abs(num)));
  const factor = Math.pow(10, cifras - d);
  return Math.round(num * factor) / factor;
}

const form = document.getElementById("resistance-form");
const resultadoDiv = document.getElementById("resultado");
const historialUl = document.getElementById("historial");

let historial = JSON.parse(localStorage.getItem("historialResistencia")) || [];

function mostrarHistorial() {
  historialUl.innerHTML = "";

  if (historial.length === 0) {
    const li = document.createElement("li");
    li.className = "text-center text-gray-500 py-3 italic";
    li.textContent = "No hay cálculos en el historial";
    historialUl.appendChild(li);
    return;
  }

  historial.forEach((item, i) => {
    const li = document.createElement("li");
    li.className = "border border-gray-200 rounded-lg p-3 bg-gray-50 hover:bg-gray-100 transition cursor-pointer";
    li.innerHTML = `
      <div class="flex justify-between items-start">
        <div>
          <span class="text-xs text-gray-500">#${i + 1}</span>
          <div class="text-sm font-medium text-gray-700">R = ${item.R} Ω ± ${item.error}%</div>
        </div>
        <span class="text-xs bg-blue-100 text-blue-800 px-2 py-1 rounded-full">${item.cifras} cifras</span>
      </div>
      <div class="grid grid-cols-2 gap-2 mt-2 text-xs text-gray-600">
        <div><span class="font-medium">V:</span> ${item.V} (${item.sigV} cifras)</div>
        <div><span class="font-medium">I:</span> ${item.I} (${item.sigI} cifras)</div>
      </div>
      <div class="mt-1 text-xs text-gray-600">
        <span class="font-medium">Error instrumento:</span> ±${item.error}%
      </div>
    `;
    historialUl.appendChild(li);
  });
}

function guardarHistorial(v, sigV, i, sigI, r, cifras, error) {
  historial.unshift({
    V: v,
    sigV,
    I: i,
    sigI,
    R: r,
    cifras,
    error,
    fecha: new Date().toLocaleString()
  });

  if (historial.length > 10) historial.pop();
  localStorage.setItem("historialResistencia", JSON.stringify(historial));
  mostrarHistorial();
}

form.addEventListener("submit", (e) => {
  e.preventDefault();

  const V = parseFloat(form.voltaje.value);
  const sigV = parseInt(form.sigV.value);
  const I = parseFloat(form.corriente.value);
  const sigI = parseInt(form.sigI.value);
  const errorInstrumento = parseFloat(form.error.value);

  if (I === 0) {
    resultadoDiv.textContent = "Error: La corriente no puede ser cero";
    resultadoDiv.className = "text-center text-lg font-semibold text-red-600 min-h-[2rem] p-3 bg-red-50 rounded-lg border border-red-100";
    return;
  }

  const cifras = Math.min(sigV, sigI);
  const resistencia = V / I;
  const resistenciaRedondeada = redondearCifrasSignificativas(resistencia, cifras);

  const errorAbsoluto = (resistenciaRedondeada * errorInstrumento) / 100;
  const errorAbsolutoRedondeado = redondearCifrasSignificativas(errorAbsoluto, cifras);

  resultadoDiv.innerHTML = `
    <div class="font-bold text-blue-800">Resistencia calculada:</div>
    <div class="text-2xl mt-1">${resistenciaRedondeada} Ω ± ${errorInstrumento}%</div>
    <div class="text-sm text-blue-600 mt-1">(con ${cifras} cifras significativas)</div>
    <div class="text-sm text-gray-600 mt-2">
      <span class="font-medium">Valor real estimado:</span> 
      ${resistenciaRedondeada} Ω ± ${errorAbsolutoRedondeado} Ω
    </div>
  `;
  resultadoDiv.className = "text-center text-lg font-semibold text-blue-700 min-h-[2rem] p-3 bg-blue-50 rounded-lg border border-blue-100";

  guardarHistorial(V, sigV, I, sigI, resistenciaRedondeada, cifras, errorInstrumento);
});

function limpiarHistorial() {
  if (confirm("¿Estás seguro de que deseas borrar todo el historial?")) {
    historial = [];
    localStorage.removeItem("historialResistencia");
    mostrarHistorial();
  }
}

window.limpiarHistorial = limpiarHistorial;

// Exportar PDF con logo y "AURATECH"
async function exportarPDF() {
  if (historial.length === 0) {
    alert("No hay datos en el historial para exportar");
    return;
  }

  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();
  const pageWidth = doc.internal.pageSize.getWidth();
  const margin = 20;

  // Cargar logo (base64 o URL)
  const imgData = "data:image/png;base64,"; // <- Reemplazar con tu logo en base64

  // Agregar logo centrado
  const imgWidth = 40;
  const imgHeight = 40;
  const imgX = (pageWidth - imgWidth) / 2;
  doc.addImage(imgData, "PNG", imgX, 10, imgWidth, imgHeight);

  // Título
  doc.setFontSize(20);
  doc.setTextColor(29, 78, 216);
  doc.text("CALCULADORA DE RESISTENCIA", pageWidth / 2, 70, { align: "center" });

  doc.setFontSize(12);
  doc.setTextColor(100, 116, 139);
  doc.setFont("helvetica", "normal");
  doc.text("Ley de Ohm - Análisis con Cifras Significativas", pageWidth / 2, 78, { align: "center" });

  doc.setDrawColor(59, 130, 246);
  doc.setLineWidth(0.5);
  doc.line(margin, 83, pageWidth - margin, 83);

  // Info
  doc.setFontSize(10);
  doc.setTextColor(0, 0, 0);

  const infoY = 90;
  const col1X = margin + 20;
  const col2X = pageWidth / 1.75 + 15;

  doc.setFont("helvetica", "bold");
  doc.text("Fecha de generación:", col1X, infoY);
  doc.text("Total de cálculos:", col2X, infoY);

  doc.setFont("helvetica", "normal");
  doc.text(new Date().toLocaleString(), col1X, infoY + 5);
  doc.text(historial.length.toString(), col2X, infoY + 5);

  const headers = [
    {
      content: "#",
      styles: { halign: 'center', fillColor: [29, 78, 216], textColor: 255, fontStyle: 'bold' }
    },
    {
      content: "Tensión (V)",
      styles: { halign: 'center', fillColor: [29, 78, 216], textColor: 255, fontStyle: 'bold' }
    },
    {
      content: "Intensidad (A)",
      styles: { halign: 'center', fillColor: [29, 78, 216], textColor: 255, fontStyle: 'bold' }
    },
    {
      content: "Resistencia (Ohm)",
      styles: { halign: 'center', fillColor: [29, 78, 216], textColor: 255, fontStyle: 'bold' }
    },
    {
      content: "Error (%)",
      styles: { halign: 'center', fillColor: [29, 78, 216], textColor: 255, fontStyle: 'bold' }
    },
    {
      content: "Cifras Sig.",
      styles: { halign: 'center', fillColor: [29, 78, 216], textColor: 255, fontStyle: 'bold' }
    }
  ];

  const data = historial.map((item, index) => [
    { content: (index + 1).toString(), styles: { halign: 'center' } },
    { content: `${item?.V ?? '-'} V`, styles: { halign: 'center', fontStyle: 'bold' } },
    { content: `${item?.I ?? '-'} A`, styles: { halign: 'center', fontStyle: 'bold' } },
    { content: `${item?.R ?? '-'} Ohm ± ${item?.error ?? '-'}%`, styles: { halign: 'center', fontStyle: 'bold' } },
    { content: `${item?.error?.toString() ?? '-'} %`, styles: { halign: 'center', fontStyle: 'bold' } },
    { content: item?.cifras?.toString() ?? '-', styles: { halign: 'center', fontStyle: 'bold' } }
  ]);

  doc.autoTable({
    startY: 105,
    head: [headers],
    body: data,
    theme: "grid",
    headStyles: { fillColor: [29, 78, 216], textColor: 255, fontStyle: "bold", halign: 'center' },
    bodyStyles: { halign: 'center' },
    alternateRowStyles: { fillColor: [241, 245, 249] },
    styles: { cellPadding: 4, fontSize: 10, valign: 'middle' },
    columnStyles: {
      0: { cellWidth: 15 },
      1: { cellWidth: 30 },
      2: { cellWidth: 32 },
      3: { cellWidth: 40 },
      4: { cellWidth: 25 },
      5: { cellWidth: 20 }
    },
    margin: { left: margin + 4, right: margin }
  });

  const pageCount = doc.internal.getNumberOfPages();
  for (let i = 1; i <= pageCount; i++) {
    doc.setPage(i);
    doc.setFontSize(10);
    doc.setTextColor(100, 116, 139);
    doc.text(`Página ${i} de ${pageCount}`, pageWidth / 2, 280, { align: "center" });

    doc.setFontSize(8);
    doc.text("Calculadora de Resistencia\nTodos los Derechos Reservados | Grupo MND-ELTR-500112700-012", pageWidth / 2, 285, { align: "center" });
  }

  const today = new Date();
  const fileName = `Resistencia_${today.getFullYear()}${(today.getMonth() + 1).toString().padStart(2, '0')}${today.getDate().toString().padStart(2, '0')}.pdf`;
  doc.save(fileName);
}

window.exportarPDF = exportarPDF;

mostrarHistorial();
